DROP TABLE IF EXISTS eventos CASCADE;
DROP TABLE IF EXISTS colecciones CASCADE;
DROP TABLE IF EXISTS usuarios CASCADE;
DROP TABLE IF EXISTS obras CASCADE;
DROP TABLE IF EXISTS tipoevento CASCADE;
DROP TABLE IF EXISTS tipobra CASCADE;
DROP TABLE IF EXISTS roles CASCADE;

-- roles
CREATE TABLE roles (
    id_rol             BIGINT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    nombre_rol         TEXT NOT NULL
);

-- tipo_obra
CREATE TABLE tipobra (
    id_tipo_obra       BIGINT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    nombre             TEXT NOT NULL
);

-- tipo_evento
CREATE TABLE tipoevento (
    id_tipo_evento     BIGINT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    nombre             TEXT NOT NULL
);

-- obras
CREATE TABLE obras (
    id_obra            BIGINT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    id_tipo_obra       BIGINT REFERENCES tipobra(id_tipo_obra) ON DELETE SET NULL,
    titulo             TEXT NOT NULL,
    descripcion        TEXT,
    imagen             BYTEA
);

-- usuarios
DROP TABLE IF EXISTS usuarios;
CREATE TABLE usuarios (
    id_azure           UUID PRIMARY KEY,
    id_rol             BIGINT REFERENCES roles(id_rol) NOT NULL,
    id_obra            BIGINT REFERENCES obras(id_obra) ON DELETE SET NULL,
    username           TEXT NOT NULL UNIQUE,
    password           TEXT NOT NULL,
    nombre_completo    TEXT NOT NULL
);

-- colecciones
CREATE TABLE colecciones (
    id_coleccion       BIGINT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    id_azure           UUID REFERENCES usuarios(id_azure) NOT NULL,
    id_rol             BIGINT REFERENCES roles(id_rol) NOT NULL,
    tematica           TEXT,
    descripcion        TEXT
);

-- eventos
CREATE TABLE eventos (
    id_eventos         BIGINT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    id_tipo_evento     BIGINT REFERENCES tipoevento(id_tipo_evento) ON DELETE SET NULL,
    id_azure           UUID REFERENCES usuarios(id_azure) ON DELETE SET NULL,
    id_rol             BIGINT REFERENCES roles(id_rol) NOT NULL,
    titulo             TEXT NOT NULL,
    descripcion        TEXT,
    fechaInicio        TIMESTAMPTZ NOT NULL,
    fechaTermino       TIMESTAMPTZ,
    precio             NUMERIC(10,2) DEFAULT 0 CHECK (precio >= 0),
    direccion          TEXT
);

CREATE INDEX idx_usuarios_id_rol ON usuarios (id_rol);
CREATE INDEX idx_usuarios_id_obra ON usuarios (id_obra);
CREATE INDEX idx_obras_id_tipo_obra ON obras (id_tipo_obra);
CREATE INDEX idx_colecciones_id_azure ON colecciones (id_azure);
CREATE INDEX idx_colecciones_id_rol ON colecciones (id_rol);
CREATE INDEX idx_eventos_id_tipo_evento ON eventos (id_tipo_evento);
CREATE INDEX idx_eventos_id_azure ON eventos (id_azure);
CREATE INDEX idx_eventos_id_rol ON eventos (id_rol);


